import React from "react";
import styled from "styled-components";

const Button = styled.button`
  background-color: #f8b319;
  border-radius: 15px;
  padding: 17px 45px;
  color: black;
  position: absolute;
  right: 0;
  bottom: 0;
  z-index: 11;
  margin-right: 20px;
  margin-bottom: 21px;
  font-family: Lato;
  font-size: 18px;
  font-weight: 800;
  line-height: 18px;
  cursor: pointer;
`;

export const WatchNowSmall = styled(Button)`
  right: 0;
  width: 160px;
`;

const WatchNow = () => {
  return <Button>Watch Now</Button>;
};

export default WatchNow;
